    true,nt"url": null,nt"notes": "The 1992 Boundary Files portion of the Archive
    of Census Related Products (ACRP) consists of 1992 boundary data from the U.S. Census
    Bureau's Topologically Integrated Geographic Encoding and Referencing (TIGER) system.
    The data have been processed to create the state boundary files for county, county
    subdivision (mcd), place, 1990 tract/block numbering area, blockgroup, and 1980
    tract and mcd's (if available). The tract and blockgroup files are grouped by MSA
    (Metropolitan Statistical Area) and CMSA (Consolidated Metropolitan Statistical
    Area). County boundary files have also been created for each census block, distinguished
    by its unique POLygon IDentification (POLID) field, matching the corresponding POLID
    in the 1990 Summary Tape File (STF) data. This portion of the ACRP is produced by
    the Columbia University Center for International Earth Science Information Network
    (CIESIN).",nt"license_title": "U.S. Government Work",nt"extras": [{ntt"key":
